import React, { Component } from "react";
import tether from "../tether.png";
import Airdrop from "./Airdrop";

// create class for component
class Main extends Component {
  render() {
    return (
      <div
        id="content"
        style={{ backgroundColor: "#FFFFFF", marginTop: "35%" }}
      >
        <div></div>
      </div>
    );
  }
}

export default Main;
